          const response = await axios.get(
            /*`https://swapi.dev/api/people/`);*/
              `https://rickandmortyapi.com/api/character/?page=?"`);

              setCharacters(response.data.results)
              //console.log(response.data.results);
          };

      const renderCharacters = () => {

